  background-color: #f5f5f5;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const Search = styled.input`
  background-color: white;
`;

export default props => {
  return (
    <Layout>
      <h1>I'm Hungry</h1>
    </Layout>
  );
};
